import React, {Component} from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
  } from 'reactstrap';

class NavBar extends Component {
    state = {
        isOpen:false,
        isOpen2:false,
        isOpen3:false,
        isOpen4:false
    }

    toggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }

    toggle2 = () => {
        this.setState({
            isOpen2: !this.state.isOpen2
        });
    }

    toggle3 = () => {
        this.setState({
            isOpen3: !this.state.isOpen3
        });
    }

    toggle4 = () => {
        this.setState({
            isOpen4: !this.state.isOpen4
        });
    }

    render() {
        return (
            <div className="w-100">
                <Navbar dark color="dark" expand="sm" className="mb-5">
                    <div className="container-fluid">
                        <NavbarBrand href="/">ShoppingList</NavbarBrand>
                        <NavbarToggler onClick={this.toggle}/>
                        <Collapse isOpen = {this.state.isOpen} navbar>
                            <Nav className="w-100" navbar>   
                                <NavItem>
                                    <p>Github</p>
                                    <NavbarToggler className="d-sm-none" onClick={this.toggle3}>
                                        <i class="fas fa-plus-circle"></i>
                                    </NavbarToggler>
                                </NavItem>
                                <NavItem>
                                    <div className="container-fluid">
                                        <div className="row w-100 m-0 p-0">
                                            <div className="col-6">
                                                <NavItem>
                                                    <NavLink href="https://github.com/bradtraversy">
                                                     <p>Github</p>
                                                    </NavLink>
                                                </NavItem>
                                            </div>
                                            <div className="col-6 d-sm-none mt-1 p-0">
                                                <NavbarToggler onClick={this.toggle3}>
                                                    <i class="fas fa-plus-circle"></i>
                                                </NavbarToggler>
                                                <Collapse isOpen = {this.state.isOpen3} navbar>
                                                    <Nav className="ml-auto" navbar>
                                                        <NavItem>
                                                            <NavLink href="https://github.com/bradtraversy">
                                                                Github
                                                            </NavLink>
                                                        </NavItem>
                                                    </Nav>
                                                </Collapse>
                                            </div>
                                        </div>
                                    </div>
                                </NavItem>
                                <NavItem>
                                    <div className="container-fluid">
                                        <div className="row w-100 m-0 p-0">
                                            <div className="col-6">
                                                <NavItem>
                                                    <NavLink href="https://github.com/bradtraversy">
                                                        <p>Github</p>
                                                    </NavLink>
                                                </NavItem>
                                            </div>
                                            <div className="col-6 d-sm-none mt-1 p-0">
                                                <NavbarToggler onClick={this.toggle4}>
                                                    <i class="fas fa-plus-circle"></i>
                                                </NavbarToggler>
                                                <Collapse isOpen = {this.state.isOpen4} navbar>
                                                    <Nav className="ml-auto" navbar>
                                                        <NavItem>
                                                            <NavLink href="https://github.com/bradtraversy">
                                                                Github
                                                            </NavLink>
                                                        </NavItem>
                                                    </Nav>
                                                </Collapse>
                                            </div>
                                        </div>
                                    </div>
                                </NavItem>
                            </Nav>
                        </Collapse>
                    </div>
                </Navbar>
            </div>
        );
    }
}

export default NavBar;
